import React from "react";
const Kitchen2 = () => (
  <div>
    <img
      className="img-fluid"
      alt="waiters mobile aplikasi kasir cafe PENJUALAN POS POINT OF SALE"
      src="https://1.bp.blogspot.com/-14vAoWoYfl4/Xsa9VFZzdCI/AAAAAAAAJgU/VlpKNFGc9Vk74b379AzXsPAyPZGFeNxqACK4BGAsYHg/resto%2Bpos%2Bweb%2Bapp%2B-%2BCopy.jpg"
    />
    <p>
      Mendukung secara penuh waiters mobile membantu mempercepat pencatatan pesanan pelanggan via smartphone waiters dalam penggunaan nya, baik smartphone android iphone waiters dapat menggunakan device nya secara real time online untuk bekerja via <a href="/">aplikasi restoran cafe rumah makan online</a> ini.
    </p>
  </div>
);

export default Kitchen2;
